import { useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import style from './Favorites.module.css';
import Card from '../Card/Card';

const Favorites = (characters) => {
  const { myFavorites } = useSelector((state) => state);
  return (
    <div>
      {myFavorites.map((character) => {
        return (
          <div>
          <Card>
            <div key={character.id}></div>
            <div className={style.title}>Name: {character.name}</div>
            <div className={style.title}>Specie: {character.species}</div>
            <div className={style.title}>Gender: {character.gender}</div>
            <img
              src={character.image}
              alt={character.name}></img>
            </Card>
            <Link to={`/detail/${detailId}`}>
              <button className={style.btnDelete}>More</button>
            </Link>
          </div>
        );
      })}
    </div>
  );
};

export default Favorites;
